import React from 'react';
import { Navigate } from 'react-router-dom';

const PrivateRoute = ({ component: Component, token, children }) => {
    if (!token) {
        return <Navigate to="/login" />;
    } else {
        return Component ? <Component /> : children;
    }
};

export default PrivateRoute;
